/**
 * Função para exibir PopUp em tela cheia<br/>
 * @param {array} json <br/>
 * • Campo <b>focus</b>:
 *      <ul>
 *          <li>
 *              <u><i>true</i></u> = focar no elemento emitente ao fechar
 *          </li>
 *          <li>
 *              <u><i>false</i></u> = não focar no elemento emitente ao fechar
 *          </li>
  *          <li>
 *              Default: <u><i>true</i></u>
 *          </li>
 *      </ul>
 * • Campo <b>function</b>:
 *      <ul>
 *          <li>
 *              <u><i>function</i></u> = função a ser executada ao abrir
 *          </li>
  *          <li>
 *              Default: <u><i>null</i></u>
 *          </li>
 *      </ul>
 * @returns void
 */
$.fn.popUp = function(json) {
//    var _this_click 
    var _this = $(this);
    
    json = json || {};
    popUpSelector = _this;
                
    function popUpClose() {

        function close() {
            
            if (json.function_close !== undefined) json.function_close();
        
            $('body').css("overflow","auto");
            $('div.popup')
                .slideUp(
                    600, 
                    function() {
                        if ( json.focus === false ) return false;
                        _this.focus();
                    }
                )                        
            ;
			$('.popup-acoes')
				.removeClass('abrir')
			;
            popUpShowing = false;
        }

        $('.popup-close')
            .click(
                close
            )
        ;
        /*
		$('body')
			.bind(
				'keydown', 
				'esc', 
				function() {
					if ( !$('.alert-principal').is(':visible') ) {
						close();
					}
				}
			)
		;   
		*/
       $('.popup-voltar2')
            .click(
                close
            )
        ;
    }

    function popUpOpen() {
        mostravoltar();
        if (json.function !== undefined) json.function();
        
        $('body').css("overflow","hidden");
        $('div.popup')
            .slideDown(800)
            .find('.modal-body')
            .scrollTop(0)
        ;
        
        popUpClose();
        
        popUpShowing = true;
        
        mostravoltar();
        
    }

    popUpOpen();
};


