        v = v / 100;

        if (s == 0)
        {
            var val = Math.round(v * 255);
            return {r:val,g:val,b:val};
        }
        hPos = h * 6;
        hPosBase = Math.floor(hPos);
        base1 = v * (1 - s);
        base2 = v * (1 - s * (hPos - hPosBase));
        base3 = v * (1 - s * (1 - (hPos - hPosBase)));
        if (hPosBase == 0) {red = v; green = base3; blue = base1}
